    for command in commands:
        if command == "UP":
            x -= 1
        elif command == "RIGHT":
            y += 1
        elif command == "DOWN":
            x += 1
        elif command == "LEFT":
            y -= 1

        # Ensure the snake remains within the grid boundaries
        x = max(0, min(x, n - 1))
        y = max(0, min(y, n - 1))

    # Calculate the final position
    return x * n + y

