def count_substrings(s: str, k: int) -> int:
    n = len(s)
    count = 0
    zero_count = 0
    one_count = 0
    start = 0

    for end in range(n):
        if s[end] == '0':
            zero_count += 1
        else:
            one_count += 1

        while zero_count > k and one_count > k:
            if s[start] == '0':
                zero_count -= 1
            else:
                one_count -= 1
            start += 1

        count += end - start + 1

    return count

